import {Link} from 'react-router-dom'

const Home = (props) => {

    return (
      
      <div className='home'>
          <div>
            <h1>Premium natural satellite real estate</h1>

            <p>Your one stop shop for our solar systems best non-planetary land offers in the galaxy!</p>
            <Link to={`/shop/`} className='text-link'>
            <button>Browse</button>
            </Link>
           
           </div>
         
      </div>
    );
  }
  export default Home;
